import React from "react";
import LoginForm from "LoginForm";

const Login = () => {
    const [res, setRes] = React.useState("");

    const onLogin = "";

    return (
            <>
            <LoginForm onLogin={onLogin} res={res} />
            </>
        )
}
export default Login;
